import './comp.css';

function Comp18() {
    let arr1 = [<p>1</p>, <p>2</p>, <p>3</p>];
    let arr2 = [
        <li>1</li>,
        <li>2</li>,
        <li>3</li>,
    ];

    return (
        <div className="comp comp18">
            <h3><span>18</span>render elems from array</h3>
            <div>{arr1}</div>
            <div>
                <ul>
                    {arr2}
                </ul>
            </div>
        </div>
    )
}

export default Comp18;
